class Solution:
    """
    @param nums: A list of integers
    @return: An integer denotes the middle number of the array
    """
    def median(self, nums):

        lstLength = len(nums)
        target = int((lstLength - 1) / 2)
        left, right = 0, lstLength - 1

        def partition(lst, left, right):
            m = left
            for k in range(left + 1, right + 1):
                if nums[k] < nums[left]:
                    m += 1
                    nums[m], nums[k] = nums[k], nums[m]
            nums[left], nums[m] = nums[m], nums[left]
            return m

        selectIndx = -1
        while selectIndx != target:
            if selectIndx > target:
                selectIndx = partition(nums, left, selectIndx)
            else:
                selectIndx = partition(nums, selectIndx + 1, right)

        return nums[selectIndx]


